	children
}) => {
	const popupStyle: CSSProperties = {
		color,
		background
	}

	return (
		<ModalContainer
			data-testid='modal-container'
			className={`modal__container ${customClass?.container}`}
			onClick={

					closeOnBackdropClick ? onRequestClose :
					() => {}
			}
			open={open}
